INSERT INTO `iso_audi_prog` (`Id`, `IdSector`, `FechaProg`, `FechaReal`, `Obs`, `IdEstado`, `HoraReal`, `Duracion`, `Obj`, `Codigo`, `IdPersonal1`, `Fecha1`, `Informe`, `Ruta`) VALUES
(1, 2, '2017-08-08', '0000-00-00', '', 1, '00:00:00', '00:00:00', 'Determinar el grado de cumplimiento de los requisitos  de los procesos respecto a los establecidos en el sistema de gestión de calidad y por la norma Iso 9001.2008', 'PGC03-02', 0, '2017-07-25', '', ''),
(2, 2, '2017-08-15', '0000-00-00', '', 1, '00:00:00', '00:00:00', '', 'PGC0302', 0, '2017-07-25', '', ''),
(3, 2, '2018-07-27', '0000-00-00', '', 1, '00:00:00', '00:00:00', 'DETERMINAR EL GRADO DE CUMPLIMIENTO DE LOS REQUISITOS DEL SGC', '', 0, '2018-06-19', '', ''),
(4, 7, '2018-07-17', '2018-07-17', 'Se  relevaron 05 acciones de mejora en base a la falta de cumplimiento de los requisitos del PDV 01 Gestión de Ventas Viajes de Placer, referidas a la falta de cumplimiento de los requisitos para el proceso de emisión de presupuestos, entrega de contrato de viaje y seguimiento de consultas.\r\nSe observó falta de conocimiento del sistema Aptour para trabajar las cancelaciones de los servicios, por ej. ; como también que el personal recientemente ingresado desconoce el lugar de archivo de la documentación del sistema  de gestión de calidad.\r\nSe recomienda trabajar las acciones de mejora en equipo (personal y gerente).\r\n\r\n\r\n', 2, '09:00:00', '03:00:00', 'Relevar el cumplimiento de los requisitos del procedimiento Gestión de Ventas Viajes de Placer.\r\n', '', 0, '2018-07-24', 'Auditada: Nadina Piñol\r\nAcción de mejora nº 01: la tabla de coeficientes utilizada para la confección de presupuestos es la enviada por mail por el Gerente Administrativo, y no la que se encuentra en el Dropbox, según lo establecido en el punto 5.1. del procedimiento. \r\n\r\nAcción de mejora nº2: falta de cumplimiento de requisitos del punto 5.1 del procedimiento Emisión del presupuesto y confirmación de la reserva, según el siguiente detalle: \r\n1.	El fee por venta de pasajes aéreos lo determina el vendedor, a su criterio. El procedimiento establece que lo determina el  Gerente Comercial.\r\n\r\n2.	El presupuesto enviado al cliente no detalla la página web de hoteles,  como tampoco se completa en todos los casos, la fecha a contactar en la Consulta. \r\n\r\n3.	No se visualiza la descripción del presupuesto (paquete) en el campo de  Observaciones Generales (file 34864).\r\n\r\n4.	No se entrega al cliente en todos los casos el contrato de viaje, como tampoco el check list También se observa falta de firma del cliente en los documentos.\r\n\r\nAcción de mejora nº 3: en el caso de cancelación de servicio y si quedara un ticket aéreo abierto, no se abre consulta para recordar al cliente según el punto 5.5. del procedimiento. \r\n\r\nAuditada: Gabriela Daprotis\r\n Idem AM 01 La tabla de coeficientes utilizada es la enviada por mail por el Gerente Administrativo y no la que se visualiza en Dropbox.\r\nIdem AM 02 El fee por venta de pasajes aéreos lo determina el vendedor a su criterio y no el Gerente Comercial; No se informa en el presupuesto enviado al cliente la página web de hoteles ; El contrato de viajes se entrega junto con los vouchers, no en el momento del primer pago\r\n\r\nAcción de mejora nº 4: se archiva el Contrato junto con el check list, según el procedimiento el check list se adjunta a la Reserva que se envía al Gerente Comercial.(punto 7 Registros) \r\n\r\nAuditada: Gabriela Rojo\r\nIdem AM1 La tabla de coeficientes utilizada es la enviada por mail por el Gerente Administrativo y no la que se visualiza en Dropbox, \r\nIdem AM 02- El fee por venta de pasajes aéreos lo determina el vendedor a su criterio y no el Gerente Comercial; no se informa en el presupuesto enviado al cliente la página web de hoteles como tampoco las formas de pago \r\n\r\nIdem AM 02 No se visualiza la descripción del presupuesto (paquete) en el campo de  Observaciones Generales, como se establece en el punto 5.1 del procedimiento. (file 36034). No se completa en todos los casos la fecha a contactar en la consulta como se establece en el punto 5.1 del procedimiento\r\n\r\nEl contrato y check list del file 36034 (MARTIN) no se especifica a qué número de file de Aptour pertenece.\r\n\r\nIdem AM 04 Archiva contrato junto con el check list, según el procedimiento el check list se adjunta a la Reserva que se envía al Gerente Comercial. \r\n\r\nIdem AM 03 En el caso de cancelación de servicio y si quedara un ticket aéreo abierto, no se abre consulta para recordar al cliente.\r\n\r\nAuditada: Guadalupe Lorente \r\nIdem AM 01 La tabla de coeficientes utilizada es la enviada por mail por el Gerente Administrativo y no la que se visualiza en Dropbox, que no está actualizada.\r\n\r\nIdem AM 02 \r\nEl fee por venta de pasajes aéreos lo determina el vendedor a su criterio y no el Gerente Comercial; \r\nno se informa en el presupuesto enviado al cliente la página web de hoteles; \r\nno se completa en todos los casos la fecha a contactar en la consulta; \r\nno completa los datos de CUIT de los pasajeros ;\r\nel contrato de viajes se entrega junto con los vouchers, no en el momento del primer pago \r\nEl file 34771 no posee Check List firmado y en el contrato no se especifica la fecha como tampoco el file de Aptour al que corresponde.\r\n\r\nAcción de mejora nº5: en la devolución del file 34482 no se describen los servicios en el campo de Observación General, tal como se establece en el punto 5.5 del procedimiento, aunque si figura la devolución a modo de Recibo. \r\n\r\nIdem AM  02 No se entrega en todos los casos el contrato de viaje, como tampoco el check list.\r\n\r\n', '');
