INSERT INTO `iso_indicadoresreq` (`Id`, `IdEnt`, `Pol`, `Obj`, `Meta`, `Accion`, `Ind`, `Frec`, `Fecha`, `IdPuesto`) VALUES
(1, 1, 'Brindar a nuestros clientes una atención personalizada, cordial y de respuesta inmediata a sus requerimientos.                Mantener actualizados los sistemas de información y brindar soporte a la gestión del servicio, con la última innovación en materia tecnológica.', 'Aumentar el grado de satisfacción del cliente sobre el servicio Ejecutivo de ventas, al 85% como excelente.', 'Brindar respuesta al cliente dentro de los 60 minutos de recibido su pedido (en horario comercial).', 'Medir la respuesta de al menos tres clientes dentro del mes, de cada ejecutivo de ventas.', 'Hora mail respuesta-hora mail solicitud <60 min: eficaz ; entre 61 y 90 gestion regular; > a 90 inefiicaz                   ', 'mensual', '2017-09-07', 4),
(2, 1, 'Participación eficaz de personal capacitado, idóneo y comprometido con los valores de la organización, en un ambiente de trabajo que permita el desarrollo de sus competencias.  Alentar la participación del personal mediante sugerencias, aportes y proyectos que puedan contribuir a mejorar la calidad del servicio', 'Desarrollar la competencia de todo el personal del Depto Corporativo. Alcanzar un 100% en evaluación de desempeño.', 'Alcanzar en la evaluación de despempeño, un 100% de calificacion como Bueno', 'realizar las evaluaciones de competencia', 'Puntuacion recibida vs puntuacion esperada. Objetivo total items \\"Bueno\\"', 'anual', '2017-11-30', 1),
(3, 1, 'Controlar, revisar y evaluar nuestros procesos con el objetivo de mejorar continuamente su eficacia', 'Mejorar continuamente la eficacia en la admisnitracion del SGC, a través de tecnologia e infraestructura', 'Implementar los modulos en la Intranet de adminsitracion del SGC; documentos/indicadores/reclamos/capacitaciones/eval de desempeño del SGC y el modulo de Personal', 'Implemetar con prov externo (PACC)', 'software implementado', 'mensual', '2017-08-31', 1);
