(1, 1, 1, 2, '2016-03-22', 2, 10, 'ISSN QUIERE QUE EL NUEVO CONTRATO NO TENGA INCREMENTADOS LOS PRECIOS EN EL NUEVO MODELO.- \r\nSE NECESITA MEDIR EL NIVEL DE SATIFACCION DEL CLIENTE.- ', 'EL CONTADOR MUÑOZ LLAMO TELEFONICAMENTE Y PIEDE QUE PARA RENOVAR EL CONTRATO NO HAY QUE AUMENTAR EL SERVICIO.-  LOS DIRECCTIVOS NO CONOCEN LOS SERVICIOS DE LA EMPRESA.- ', 2, 'ANALIZAR SI LOS MONTOS ACTUALES DE CARGOS DE EMISION PARA FIRMAR EL NUEVO CONTRATO.- REALIZACION DE UNA ENCUETA DE CALIDAD PARA MEDIR EL NIVEL DE SERVICIO OFRECIDO.- ', 2, 10, 2, '2016-03-22', '2016-04-05', '2016-04-05', 2),
(2, 2, 2, 5, '2016-05-03', 2, 7, 'Candela Sánchez no se presento a trabajar por enfermedad. En vez de informar a sus superiores mando a una compañera a informar.- ', 'no hay procedimiento establecido para gestionar estas solicitudes.- ', 10, 'Agregar en el procedimiento de gestion de RRHH que deben comunicar por mensaje al Gerente en caso de no presentarse por enfermedad o por cualquier motivo.', 10, 10, 2, '2016-05-09', '2016-06-07', '2016-12-01', 2),
(4, 3, 1, 3, '2016-07-19', 10, 2, 'A raíz del reclamo del cliente Vázquez (x3), originado en que la tercer cama ofrecida por el Hotel fue un catre, lo cual no cumplió con la comodidad esperada por el cliente.', 'La generalización de la tercer cama como el resto de las habitaciones, sobre todo en el Caribe, por parte del proveedor.', 2, 'Capacitar al vendedor sobre como ofrecer el servicio en caso de tercer cama y la importancia de advertir al cliente.\r\nincluir en el Contrato de viaje esta situación.', 2, 0, 10, '2016-07-29', '0000-00-00', '2016-08-23', 2),
(5, 4, 3, 1, '2016-10-21', 10, 5, 'Se observa que la documentación entregada al ISSN para su autorización no cumple con los requisitos establecidos en el punto 5.3 del procedimiento PDC 03; como también se ha modificado la preparación del expediente (punto 5.4).', 'A raiz del cambio de administración en el ISSN se ha modificado el proceso de preparación del expediente. ', 5, 'MOdificar el procedimiento con los nuevos requisitos del cliente.', 5, 10, 10, '2016-10-25', '2016-10-25', '2016-11-08', 2),
(6, 5, 2, 1, '2016-10-21', 10, 10, 'Se observa que no se utiliza el modelo de solicitud de requisitos al cliente, establecido en el Anexo del procedimiento PDC 01', 'No se solicitan los requisitos con este modelo, se hace directamente por mail.', 10, 'MOdificar el procedimiento y eliminar este requisito.', 10, 10, 10, '2016-10-26', '2016-11-08', '2016-11-08', 2),
(7, 6, 3, 1, '2016-10-21', 10, 2, 'Se observan pedidos de la familia Crexel y de la empresa Comarsa que son gestionados sin la confirmación vía mail, tal lo requerido por el procedimiento PDC 01; salvo que sea autorizado por el Gerente Comercial. No consta esta autorización.', '', 0, 'se envía mail para autorizar a la familia crexel y hay que solicitar a comarsa que envíe la confirmación por mail.- ', 2, 0, 10, '2016-12-30', '0000-00-00', '2017-01-03', 2),
(8, 7, 3, 1, '2016-10-21', 10, 10, 'No se observa medición del mes de agosto, tal lo establecido en el documento “frecuencia de medición cada 30 días”.DGC 05 Tiempo de respuesta', 'olvido!!!', 10, 'relevamiento y carga en intranet', 10, 10, 10, '2016-11-08', '2016-11-08', '2016-11-08', 2),
(9, 8, 3, 1, '2017-08-01', 10, 4, 'No se esta utilizando el Anexo I del proced PDC02 Compras; respecto al pedido de alojamiento por el cliente.', '', 0, '', 0, 0, 0, '0000-00-00', '0000-00-00', '0000-00-00', 2),
(10, 9, 3, 1, '2017-08-01', 10, 2, 'La base de proveedores no se encuentra actualizada, tal lo requerido por el procedimiento PDC02 Compras y evalaucion de proveedores', 'se analiza la nueva metodología de carga para mantenerla actualizada y que se informe las bajas a los vendedores para que puedan tener conocimiento ', 10, 'Que la pagina de inicio de la intranet SOPA, que se utiliza para gestionar el pago a un proveedor, muestre el proveedor dado de baja. Debe cargar en NOTICIAS el Gerente.', 10, 0, 0, '2017-10-17', '0000-00-00', '0000-00-00', 2),
(11, 10, 1, 1, '2017-08-01', 10, 2, 'SOlicitar modificacion a la Intranet en cuanto al ingreso del reporte de guardia: agregar o actualizar los clientes y agregar en MOtivo, el de RESERVA DE HOTEL', '', 0, 'modificacion del sistema Intranet', 2, 10, 2, '2017-08-08', '2017-08-15', '2017-08-15', 2),
(12, 11, 2, 1, '2017-08-01', 10, 2, 'No se estan realizando las capacitaciones planteadas en el PLAN ANUAL. Se recomienda hacer el seguimiento.', 'No fue necesaria realizar los cursos propuestos y se esta evaluando las nuevas capacitaciones. ', 2, 'Amadeus. sistema de pago con TC.- ', 0, 0, 0, '2017-11-15', '0000-00-00', '0000-00-00', 2),
(13, 12, 3, 1, '2017-08-15', 10, 1, 'No se están realizando los controles sobre venta aéreos y buses, con la frecuencia establecida en el procedimiento PDC01 Gestion de ventas servicio corporativo.', '', 0, '', 0, 0, 0, '0000-00-00', '0000-00-00', '0000-00-00', 1),
(14, 13, 2, 5, '2017-10-17', 10, 2, 'Solicitar mejoras al proveedoro Intranet para gestionar las licencias segun el instructivo', 'no carga automáticamente la cantidad de días de licencia ', 0, 'comunicar a nonthue ', 10, 0, 0, '2017-10-17', '0000-00-00', '0000-00-00', 2),
(16, 15, 3, 1, '2018-07-10', 10, 1, 'no se encuntra el formulario de Alta Cliente UTA en la carpeta correspondiente.', '', 0, '', 0, 0, 0, '0000-00-00', '0000-00-00', '0000-00-00', 2),
(17, 16, 3, 1, '2018-07-17', 16, 1, 'La tabla de coeficientes utilizada es la enviada por mail por el Gerente Administrativo y no la que se visualiza en Dropbox,  según lo establecido en el punto 5.1. del procedimiento.', '', 0, '', 0, 0, 0, '0000-00-00', '0000-00-00', '0000-00-00', 2),
(18, 17, 3, 1, '2018-07-17', 16, 2, 'Falta de cumplimiento del punto 5.1 Emisión de presupuesto del PDV 01 gestion de ventas viajes de placer:\r\n1.	El fee por venta de pasajes aéreos lo determina el vendedor, a su criterio. El procedimiento establece que lo determina el  Gerente Comercial.\r\n\r\n2.	El presupuesto enviado al cliente no detalla la página web de hoteles,  como tampoco se completa en todos los casos, la fecha a contactar en la Consulta. \r\n\r\n3.	No se visualiza la descripción del presupuesto (paquete) en el campo de  Observaciones Generales (file 34864).\r\n\r\n4.	No se entrega al cliente en todos los casos el contrato de viaje, como tampoco el check list También se observa falta de firma del cliente en los documentos.\r\n5. No se completa en todos los casos la fecha a contactar en la consulta .\r\n6. No completa los datos de CUIT de los pasajeros en todos los casos.\r\n7. El contrato y check list del file 36034 (MARTIN) no se especifica a qué número de file de Aptour pertenece.\r\n8. El file 34771 no posee Check List firmado y en el contrato no se especifica la fecha como tampoco el file de Aptour al que corresponde', '1.cambio de procedimiento\r\n2. cambio de procedimiento \r\n3 cambio de procedimiento.- \r\n', 0, '3 poner un comentario del paquete y los datos del servicio detallado \r\n4,5,6 nuevamente se realizara una reunión para fijar procedimiento ', 2, 2, 0, '2018-09-13', '2018-10-12', '0000-00-00', 1),
(19, 18, 3, 1, '2018-07-24', 16, 2, 'En el caso de cancelación de servicio y si quedara un ticket aéreo abierto, no se abre consulta para recordar al cliente según el punto 5.5. del procedimiento PDV 01 gestion de ventas viajes de placer', '', 0, '', 0, 0, 0, '0000-00-00', '0000-00-00', '0000-00-00', 2),
(20, 19, 3, 1, '2018-07-24', 16, 2, 'Falta de cumplimiento del punto 7 Registros del PDV 01 Gestion de ventas viajes de placer:\r\nSe archiva el Contrato junto con el check list, según el procedimiento el check list se adjunta a la Reserva que se envía al Gerente Comercial.', 'no se conoce el procedimiento ', 2, 'se realizaran reuniones para fijar normas ', 2, 2, 0, '2018-09-13', '2018-10-12', '0000-00-00', 1),
(21, 20, 3, 1, '2018-07-24', 16, 2, 'FAlta de cumplimiento del requisito 5.5  del PDV 01 gestion de venta de viajes deplacer:\r\nEn la devolución del file 34482 no se describen los servicios en el campo de Observación General, aunque si figura la devolución a modo de Recibo.', 'no se conoce el procedimiento', 0, 'se realizará un reunión para fijar el procedimiento ', 0, 0, 0, '2018-09-13', '2018-10-12', '0000-00-00', 1);
