INSERT INTO `iso_reclamost` (`Id`, `Fecha`, `IdPersonal`, `Cliente`, `IdProveedor`, `NFA`, `Des`, `Ana`, `Acc`) VALUES
(1, '2017-06-27', 8, 'masramon/cardone', 35, 0, '16 de junio\r\nHola directivos de Sebastian Viajes.\r\nRealice con su empresa  de viajes el paquete de Ilusion europea vendidos por su empresa en aproximadamente seis mil dolares. desde el 23 de Mayo  hasta el 13 de Junio de 2017 .\r\nEl paquete fue armado  por TRAYECTO UNO  de Bs As,empresa de viajes y turismo y en Europa  el contacto en todo el trayecto  fue ejecutado por TRAPSATUR SA de la ciudad de Madrid España.\r\nSe que a ustedes no les puede interesar conservar o perder un cliente.pero al menos deben saber porque no volveria a viajar con su empresa NUNCA!!!!\r\nMi desilusion fue enorme al ver y sufrir en carne propia la ineptitud del guia Bautista Martino  y la prepotencia del guia local Joaquin,  amen de decirles que los hoteles  fueron cambiados del paquete original (sujetos a cambio se lee en el texto) pero se supone que por uno similar, no solo estaba retirado del centro de cada ciudad visitada sino que su servicio dejaba mucho que desear.\r\nPasamos la mitad el viaje arriba de un BUS sin comodidades y servicios necesarios para trayectos tan extensos como son 600 km, este punto no se deja entrever cuando uno lee el paquete, luego viene  la sorpresa!!! nos enfermamos el 80 por % del pasaje!!\r\nDeseo de corazon no continuen estafando a la gente!!!. &#128530;\r\nsaludos MASRAMON / CARDONE.', 'Al cliente se le comunicó al momento de la compra, que los hoteles están sujetos a cambios; se cree conveniente transmitir el reclamos sobre el servicio del guia.', 'Lamento enormemente que el viaje no haya salido como lo habías pensado, traté de comunicarme por teléfono pero no pude ubicarte.\r\nPara nosotros es sumamente importante la opinión de nuestros  pasajeros, por ese motivo , el dueño de la agencia se va a estar comunicando con vos para  que le cuentes más detalles de tu experiencia,.\r\n \r\n \r\nSaludos cordiales, Gabriela\r\n Luego, se contacta el Gerente y se le comunica al operador el reclamo, sobre todo del guia. Se aguarda respuesta a la fecha (27/06)\r\nSe contactaron a otros pasajeros para saber si tenian la misma percepcion del servicio, coincidiendo en el reclamo del guia.');
